import React from 'react';
import styles from './TransactionHistory.module.css';
import transactionList from './transactionList.json';

const TransactionHistory = (props) => (
	<div className={styles.tableWrapper}>
		<div className={styles.hometasktitle} />
		<table className={styles.table_blur}>
			<thead>
				<tr>
					<th>Type</th>
					<th>Amount</th>
					<th>Currency</th>
				</tr>
			</thead>
			<tbody>
				{transactionList.map((el) => {
					return (
						<tr>
							<td>{el.type}</td>
							<td>{el.amount}</td>
							<td>{el.currency}</td>
						</tr>
					);
				})}
			</tbody>
		</table>
	</div>
);

export default TransactionHistory;
